  ///  Exercise Description Strings
  'ex_desc_1': "Stellen Sie sich mit den Armen auf dem Boden, die in der Schulterhöhe direkt zur Seite ausgefallen sind.\n\nbewegen Sie Ihre Arme im Uhrzeigersinn in großen Kreisen schnell.\n\nVersuchen Sie, es so schnell wie möglich zu tun.\n\nEs ist eine großartige Übung für den Deltamuskel.",
  'ex_desc_2': "Beginnen Sie mit Ihren Füßen und den Armen an Ihren Seiten und springen Sie dann mit Ihren Füßen und den Händen über den Kopf.\n\nkehren zur Startposition zurück, dann machen Sie den nächsten Repräsentanten.\n\nDiese Übung bietet ein Ganzkörpertraining und arbeitet alle Ihre LT-Muskelgruppen.",
  'ex_desc_3': "Stehen Sie mit Ihren Füßen und den Armen an Ihren Seiten aufrecht.\n\nsteigen Sie einen Fuß zur Seite, heben Sie Ihre Arme hoch und bringen Sie Ihre Hände über uns.\n\nzurückkehren, die Seiten wechseln und die Übung wiederholen.",
  'ex_desc_4': "Stellen Sie sich mit der Schulterbreite Ihrer Füße auseinander und Ihre Arma streckte sich nach vorne und senken Sie dann Ihren Körper, bis Ihre Oberschenkel parallel zum Boden sind.\n\nIhre Knie sollten in die gleiche Richtung wie Ihre Zehen verlängert werden.\n\nkehren zur Startposition zurück und machen Sie den nächsten Repräsentanten.\n\nDies funktioniert die Oberschenkel, das Hüftschatz, Quads, die Kniesehnen und den Unterkörper.",
  'ex_desc_5': "Beginnen Sie mit den Knien unter Ihrem Hintern und Ihren Händen unter Ihren Schultern an allen vieren. Heben Sie Ihr rechte Bein und drücken Sie Ihren Hintern so viel wie möglich an. Gehen Sie zurück zur Startposition und wiederholen Sie die Übung.",
  'ex_desc_6': "Beginnen Sie mit den Knien unter Ihrem Hintern und Ihren Händen unter Ihren Schultern an allen vieren. Hebe dein linkes Bein und drücke deinen Hintern so viel wie möglich. Gehen Sie zurück zur Startposition und wiederholen Sie die Übung.",
  'ex_desc_7': "Legen Sie sich mit gebogenen Knien auf dem Rücken auf dem Boden. Legen Sie Ihre Arme flach an Ihre Seiten.\n\ndann heben Sie Ihren Hintern auf und ab.",
  'ex_desc_8': "Beginnen Sie mit den Knien unter Ihrem Hintern und Ihren Händen direkt unter Ihren Schultern.\n\ndann atmen Sie einen Atem und lassen Sie Ihren Bauch fallen, die Schultern rollen zurück und der Kopf kommt zur Decke.\n\nWährend Sie ausatmen, rücken Sie Ihren Rücken nach oben und lassen Sie Ihren Kopf herunterkommen.\n\nwiederholen Sie die Übung. Machen Sie es mit jedem Schritt dieser Übung langsam.",
  'ex_desc_9': "Stehen Sie mit Ihren Füßen schulterbreit auseinander. Bringen Sie Ihr Knie auf Ihren gegenüberliegenden Ellbogen.\n\nkehren zur Startposition zurück und wiederhole mit der anderen Seite.",
  'ex_desc_10': "Stehen Sie mehrere Fuß von einer Bank entfernt. Ruhen Sie Ihren linken Fuß auf die Bank hinter sich. Senken Sie Ihren Körper, bis Ihr Rückenknie fast den Boden berührt und Ihr vorderer Oberschenkel parallel zum Boden ist.\n\ngehen Sie zurück zur Startposition und wiederholen Sie die Übung.\n\nEs sollte genug Platz zwischen Ihrem vorderen Fuß und der Bank geben, damit Ihr vorderes Knie nicht über Ihre Zehen geht. Halten Sie Ihren Oberkörper gerade.\n\nEs ist eine großartige Übung für den Gluteus und die Kniesehne.",
  'ex_desc_11': "Stehen Sie mehrere Fuß von einer Bank entfernt. Ruhen Sie Ihren rechten Fuß auf die Bank hinter sich. Senken Sie Ihren Körper, bis Ihr Rückenknie fast den Boden berührt und Ihr vorderer Oberschenkel parallel zum Boden ist.\n\ngehen Sie zurück zur Startposition und wiederholen Sie die Übung.\n\nEs sollte genug Platz zwischen Ihrem vorderen Fuß und der Bank geben, damit Ihr vorderes Knie nicht über Ihre Zehen geht. Halten Sie Ihren Oberkörper gerade.\n\nEs ist eine großartige Übung für den Gluteus und die Kniesehne.",
  'ex_desc_12': "Stellen Sie sich mit einem Ihrer Beine nach vorne und Ihren Knien leicht gebeugt. Beugen Sie Ihre Ellbogen und drücken Sie Ihre Fäuste vor Ihrem Gesicht.\n\nverlängern einen Arm nach vorne mit der Handfläche auf den Boden. Nehmen Sie den Arm zurück und wiederholen Sie den anderen Arm.",
  'ex_desc_13': "Beginnen Sie in der Plankenposition der geraden Arm. Dann heben Sie sich die Beine abwechselnd an und senken Sie sie nach oben. \n",
  'ex_desc_14': "Legen Sie sich auf den Bauch und beugen Sie Ihre Ellbogen mit Ihren Händen unter Ihren Schultern. Schieben Sie Ihre Brust so weit wie möglich vom Boden hoch. Kehren Sie zur Startposition zurück und wiederholen Sie dies.",
  'ex_desc_15': "Stellen Sie sich mit Ihrer rechten Hand und der linken Hand auf Ihrer Taille. Bringen Sie Ihren rechten Ellbogen und Ihren rechten Knie, um sich zu treffen. Ausdehnen und wiederholen.",
  'ex_desc_16': "Stellen Sie sich mit Ihrer linken Hand und der rechten Hand auf Ihrer Taille. Bringen Sie Ihren linken Ellbogen und das linke Knie, um sich zu treffen. Ausdehnen und wiederholen.",
  'ex_desc_17': "Legen Sie sich mit einem 90 -Grad -Winkel und Ihren Händen hinter Ihrem Kopf auf dem Rücken. Heben Sie Ihren Oberkörper und Ihre Oberschenkel an und strecken Sie sich dann aus.\n\nwiederholen Sie diese Übung.",
  'ex_desc_18': "Beginnen Sie mit den Knien unter Ihrem Hintern und Ihren Händen direkt unter Ihren Schultern. Biege deine Ellbogen und mach einen Liegestütz. Kehren Sie zur Startposition zurück und wiederholen Sie dies.",
  'ex_desc_19': "Beginnen Sie mit den Knien unter Ihrem Hintern und Ihren Händen unter Ihren Schultern an allen vieren. Heben Sie Ihr rechte Bein in einem Winkel von 90 Grad an die Seite an die Seite.",
  'ex_desc_20': "Beginnen Sie mit den Knien unter Ihrem Hintern und Ihren Händen unter Ihren Schultern an allen vieren. Heben Sie Ihr linkes Bein dann in einem Winkel von 90 Grad an die Seite.",
  'ex_desc_21': "Legen Sie sich auf Ihre Seite mit dem Kopf auf Ihrem rechten Arm. Heben Sie Ihr Oberbein nach oben und kehren Sie zur Startposition zurück.\n\nstellen Sie sicher, dass Ihr rechtes Bein während der Übung direkt auf und ab geht.\n\nEs ist eine großartige Übung für den Gluteus.",
  'ex_desc_22': "Legen Sie sich auf Ihre Seite mit dem Kopf auf Ihrem rechten Arm. Heben Sie Ihr Oberbein nach oben und kehren Sie zur Startposition zurück.\n\nstellen Sie sicher, dass Ihr linkes Bein während der Übung direkt auf und ab geht.\n\nEs ist eine großartige Übung für den Gluteus.",
  'ex_desc_23': "Legen Sie sich mit Ihren Händen hinter Ihren Ohren auf dem Boden. Heben Sie die Knie an und schließen Sie Ihren rechten Ellbogen zu Ihrem linken Knie und schließen Sie dann Ihren linken Ellbogen zu Ihrem rechten Knie.\n\nwiederholen Sie die Übung.",
  'ex_desc_24': "Stellen Sie sich mit Ihren Füßen schulterbreit und Ihre Hände auf Ihren Hüften. Machen Sie mit Ihrem rechten Bein einen Schritt nach vorne und senken Sie Ihren Körper, bis Ihr rechter Oberschenkel parallel zum Boden ist.\n\ndann kehren Sie zurück und wechseln Sie zum anderen Bein.\n\nDiese Übung stärkt den Quadrizeps, den Gluteus maximus und die Kniesehnen.",
  'ex_desc_25': "Stellen Sie sich mit Ihren Händen auf Ihren Hüften und Füßen, die etwas breiter als die Schulterbreite voneinander entfernt sind.\n\nDann senken Sie Ihren Körper, bis Ihre Oberschenkel parallel zum Boden sind.\n\nIhre Knie sollten in die gleiche Richtung wie Ihre Zehenspitzen verlängert werden.",
  'ex_desc_26': "Legen Sie sich mit flacher Füße auf dem Rücken auf dem Boden. Legen Sie Ihren rechten Knöchel auf das linke Knie. Heben Sie Ihr linkes Knie an und schnappen Sie sich mit beiden Händen die Rückseite von Ihrem linken Oberschenkel. Ziehen Sie es vorsichtig zu Ihrem Körper.",
  'ex_desc_27': "Legen Sie sich mit flacher Füße auf dem Rücken auf dem Boden. Legen Sie Ihren linken Knöchel auf Ihr rechtes Knie. Heben Sie Ihr rechtes Knie an und schnappen Sie sich mit beiden Händen die Rückseite von Ihrem rechten Oberschenkel. Zieh es sanft zu deinem Körper.",
  'ex_desc_28': "Beginnen Sie in der Liegestütze. Biegen Sie Ihr rechtes Knie in Richtung Brust und halten Sie Ihr linkes Bein gerade. Schalten Sie dann schnell von einem Bein zum anderen.\n\nDiese Übung stärkt mehrere Muskelgruppen.",
  'ex_desc_29': "Legen Sie sich mit Ihren Armen auf dem Rücken an Ihren Seiten. Heben Sie Ihre Beine an und halten Sie sie so gerad wie möglich. Heben Sie dann schnell Ihr rechte Bein nach oben und senken Sie gleichzeitig Ihr linkes Bein.\n\nSchalten Sie die Beine und wiederholen Sie.",
  'ex_desc_30': "Stellen Sie sich mit Ihren Füßen weit voneinander entfernt und Ihre Hände ruhten auf Ihren Hüften.\n\ndann beugen Sie Ihr linkes Bein und lehnen Sie Ihren Körper zur linken Seite.\n\nhalten die Position für einige Sekunden, kehren Sie dann zurück und wiederholen Sie dies mit der anderen Seite.",
  'ex_desc_31': "Stehen Sie direkt auf.\n\ntreten Sie dann mit Ihrem linken Bein nach rechts zurück und beugen Sie sich gleichzeitig die Knie.\n\ngehen Sie zurück zur Startposition und wechseln Sie zur anderen Seite.",
  'ex_desc_32': "Stehen Sie direkt auf.\n\ndann treten Sie Ihren rechten Bein zurück und senken Sie Ihren Körper. Wenn Sie aufkommen, heben Sie Ihr rechte Knie so hoch wie möglich. Gehen Sie zurück zur Startposition und wiederholen Sie die Übung.",
  'ex_desc_33': "Stehen Sie direkt auf.\n\ndann treten Sie Ihren linken Bein zurück und senken Sie Ihren Körper. Wenn Sie aufkommen, heben Sie Ihr linkes Knie so hoch wie möglich. Gehen Sie zurück zur Startposition und wiederholen Sie die Übung.",
  'ex_desc_34': "Machen Sie einen großen Schritt nach vorne mit Ihrem rechten Bein und halten Sie Ihren Oberkörper gerade.\n\nDann lass deinen Körper direkt nach unten und nach oben gehen.",
  'ex_desc_35': "Machen Sie einen großen Schritt nach vorne mit Ihrem linken Bein und halten Sie Ihren Oberkörper gerade.\n\nDann lass deinen Körper direkt nach unten und nach oben gehen.",
  'ex_desc_36': "Steh gerade mit deinen Füßen zusammen. Bewegen Sie Ihr rechtes Bein zur Seite und senken Sie Ihren Körper, während Sie Ihr linkes Bein gerade halten.\n\ngehen Sie zurück zur Startposition und wechseln Sie zur anderen Seite.",
  'ex_desc_37': "Legen Sie sich hin und beugen Sie Ihre Knie mit flach auf dem Boden. Überquere deine Arme vor deine Brust. Heben Sie dann Ihren Kopf und Ihre Schultern auf, um einen Winkel von 30 Grad mit dem Boden zu erzielen.\n\nEs funktioniert hauptsächlich auf dem Rektus abdominis Muskel und Schrägen.",
  'ex_desc_38': "Legen Sie sich mit den Knien in einem Winkel von 90\nauf dem Rücken und Ihre Arme in Richtung der Decke. Senken Sie Ihr rechtes Bein und verlängern Sie Ihren linken Arm über Ihren Kopf.\n\nhalten Sie es eine Sekunde lang, kehren Sie dann zur Startposition zurück und wiederholen Sie dies mit der anderen Seite.",
  'ex_desc_39': "Legen Sie sich auf den Rücken und legen Sie Ihre Hände unter Ihre Hüften, um sie zu unterstützen. Heben Sie dann Ihre Beine nach, bis sie mit dem Boden aus einem rechten Winkel ausgestattet sind. Bringen Sie Ihre Beine langsam zurück und wiederholen Sie die Übung.",
  'ex_desc_40': "Legen Sie sich mit verlängerten Beinen und Ihren Ellbogen direkt unter Ihren Schultern auf dem Rücken. Heben Sie Ihr linkes Bein in einem Winkel von 45 Grad nach oben, während Sie Ihren rechten Arm auf Ihre linke Seite erreichen.\n\ngehen dann langsam zur Ausgangsposition zurück.\n\nwiederholen Sie mehrmals und wechseln Sie dann auf die andere Seite.",
  'ex_desc_41': "Legen Sie sich mit Ihren Zehen und Unterarmen auf dem Boden auf dem Boden. Halten Sie Ihren Körper gerade und halten Sie diese Position so lange wie möglich.\n\nDiese Übung stärkt den Bauch, den Rücken und die Schultern.",
  'ex_desc_42': "Legen Sie sich mit Ihren Armen auf dem Rücken an Ihren Seiten und sind leicht angehoben. Heben Sie Ihre Beine vom Boden ab, beugen Sie Ihre Knie und ziehen Sie sie in Richtung Ihrer Brust.\n\ntreten Sie Ihre Füße nach vorne und wiederholen Sie sie.",
  'ex_desc_43': "Stellen Sie sich auf dem Boden auf und laufen Sie dann an, während Sie Ihre Ferse auf den neuesten Stand bringen, um Ihren Hintern mit jedem Schritt zu berühren.\n\nVersuchen Sie, es so schnell wie möglich zu tun.\n\nEs ist eine großartige Übung für den Gluteus und die Harmstrings.",
  'ex_desc_44': "Legen Sie sich mit Ihrem linken Fuß hinter Ihrem rechten Fuß auf Ihrer linken Seite. Legen Sie Ihre rechte Hand hinter Ihren Kopf und Ihre linke Hand auf der rechten Seite Ihrer schrägen Muskeln. Heben Sie Ihre linke Schulter vom Boden hoch.\n\nwiederholen Sie die Übung.",
  'ex_desc_45': "Legen Sie sich mit Ihrem rechten Fuß hinter Ihrem linken Fuß auf Ihrer rechten Seite. Legen Sie Ihre linke Hand hinter Ihren Kopf und Ihre rechte Hand auf der linken Seite Ihrer schrägen Muskeln. Heben Sie Ihre rechte Schulter vom Boden hoch.\n\nwiederholen Sie die Übung.",
  'ex_desc_46': "Legen Sie sich mit gebogenen Beinen und den Armen auf dem Boden an Ihren Seiten. Heben Sie Ihren Oberkörper leicht vom Boden ab und lassen Sie Ihre Hände abwechselnd Ihre Fersen erreichen.",
  'ex_desc_47': "Setzen Sie sich mit gebogenen Knien auf den Boden, die Füße hielten ein wenig und den Rücken nach hinten. Heben Sie Ihre Beine abwechselnd an und klatschen Sie unter die Knie.",
  'ex_desc_48': "Legen Sie sich mit ausgedehnten Armen auf dem Bauch. Dann heben Sie sowohl Ihre Arme als auch die Beine vom Boden hoch.\n\nhalten diese Position zwei Sekunden lang. Kehren Sie zur Startposition zurück und wiederholen Sie dies.",
  'ex_desc_49': "Legen Sie sich mit gestreckten Beinen und Ihren Händen unter Ihren Hüften auf dem Rücken. Heben Sie Ihre Knie an, bis Ihre Oberschenkel senkrecht zum Boden sind. Richten Sie Ihre\nBeine und heben Sie Ihre Hüften vom Boden hoch.\n\nkehren zur Ausgangsposition zurück und wiederholen Sie die Übung. \n",
  'ex_desc_50': "Beginnen Sie mit den Knien unter Ihrem Hintern und Ihren Händen unter Ihren Schultern.\n\nStrecken Sie dann gleichzeitig Ihr rechtes Bein und Ihren linken Arm.\n\nhalten fünf Sekunden lang, dann gehen Sie zurück und wiederholen Sie mit dem anderen.",
  'ex_desc_51': "Legen Sie sich auf Ihrer linken Seite mit Ihrem Unterarm, der Ihren Oberkörper und Ihre rechte Hand auf dem Boden vor Ihnen stützt.\n\nhalten beide Beine zusammen. Heben Sie Ihre Beine leicht an und halten Sie eine Sekunde lang gedrückt und kehren Sie dann zur Position der Startposition zurück. Wiederholen Sie die Übung.",
  'ex_desc_52': "Legen Sie sich auf Ihrer rechten Seite mit Ihrem Unterarm, der Ihren Oberkörper und Ihre linke Hand auf dem Boden vor Ihnen stützt.\n\nhalten beide Beine zusammen. Heben Sie Ihre Beine leicht an und halten Sie eine Sekunde lang gedrückt und kehren Sie dann zur Position der Startposition zurück. Wiederholen Sie die Übung. \n",
  'ex_desc_53': "Setzen Sie sich mit gebogenen Knien auf den Boden, die Füße hielten ein wenig und den Rücken nach hinten. Halten Sie dann Ihre Hände zusammen und drehen Sie sich von Seite zu Seite.",
  'ex_desc_54': "Beginnen Sie in der regulären Liegestütze, aber mit den Händen auf einem Stuhl oder einer Bank. Schieben Sie Ihren Körper mit Ihrer Armstärke nach unten. Denken Sie daran, Ihren Körper gerade zu halten.",
  'ex_desc_55': "Stehen Sie direkt auf. Treten Sie dann mit Ihrem linken Bein zurück und senken Sie Ihren Körper. Wenn Sie hochkommen, treten Sie Ihr linkes Bein nach oben. Gehen Sie zurück zur Startposition und wiederholen Sie die Übung.",
  'ex_desc_56': "Stehen Sie direkt auf. Treten Sie dann mit Ihrem rechten Bein zurück und senken Sie Ihren Körper. Wenn Sie hochkommen, treten Sie Ihr rechtes Bein nach oben. Gehen Sie zurück zur Startposition und wiederholen Sie die Übung.",
  'ex_desc_57': "Setzen Sie sich für die Startposition auf den Stuhl. Bewegen Sie dann Ihre Hüfte vom Stuhl, wobei Ihre Hände die Kante des Stuhls halten. Biege dich langsam und strecke deine Arme, damit dein Körper auf und ab geht. Dies ist eine großartige Übung für den Trizeps.",
  'ex_desc_58': "Stehen Sie mit Ihren Füßen etwas breiter als die Schulterbreite, die Ellbogen gebogen, Handflächen, die jeweils zugewandt sind, und die Finger zeigten zur Decke. Senken Sie Ihren Körper, bis Ihre Oberschenkel parallel zum Boden sind. Wenn Sie nach oben kommen, drehen Sie Ihren Körper in die links, begradigen Sie sich Ihr rechtes Bein, heben Sie Ihre rechte Ferse und strecken Sie sich und erreichen Sie Ihren rechten Arm nach links.\n\nkehren zur Startposition zurück und wiederhole mit der anderen Seite.",
  'ex_desc_59': "Legen Sie sich mit gebeugtem und nach vorne gestreckten Armen auf dem Rücken. Heben Sie Ihren Oberkörper vom Boden ab.\n\nhalten einige Sekunden und kehren langsam zurück.\n\nEs funktioniert hauptsächlich den Rektus abdominis -Muskel und die Schrägen.",
  'ex_desc_60': "Legen Sie sich auf Ihrer linken Seite, wobei Ihr Kopf auf Ihrem linken Arm und den Beinen verlängert wird.\n\nheben und beugen Sie Ihr rechtes Knie vor sich, dann treten Sie dann Ihr Bein zurück. Wiederholen Sie die Übung.",
  'ex_desc_61': "Legen Sie sich auf der rechten Seite, wobei Ihr Kopf auf Ihrem rechten Arm und den Beinen verlängert wird.\n\nheben und beugen Sie Ihr linkes Knie vor sich, dann treten Sie dann Ihr Bein zurück. Wiederholen Sie die Übung.",
  'ex_desc_62': "Legen Sie sich auf den Bauch und beugen Sie Ihre Ellbogen mit Ihren Händen unter Ihren Schultern. Schieben Sie Ihre Brust so weit wie möglich vom Boden hoch.\n\nhalten diese Position für Sekunden.",
  'ex_desc_63': "Stehen Sie mit Ihren Füßen schulterbreit auseinander. Beuge\ndeine Arme vor dir, um das Gleichgewicht zu halten. Senken Sie Ihren Körper, bis Ihre Oberschenkel parallel zu\nauf dem Boden sind. Kommen Sie auf halbem Weg nach oben, anstatt alle auf den Weg nach oben zu kommen, und hocken Sie dann wieder hin. Wiederholen.",
  'ex_desc_64': "Legen Sie sich flach auf dem Rücken mit Ihrem rechten Bein\ndirekt auf dem Boden, und Ihr linkes Bein bückte sich mit Ihrem linken Fuß flach auf dem Boden. Ziehen Sie das rechte Bein fest und heben Sie es direkt an, bis Ihre Oberschenkel parallel sind, und senken Sie es dann langsam ab.",
  'ex_desc_65': "Legen Sie sich flach auf dem Rücken mit Ihrem linken Bein\ndirekt auf dem Boden, und Ihr rechtes Bein bog\nmit Ihrem rechten Fuß flach auf dem Boden. Ziehen Sie das linke Bein fest und heben Sie es direkt an, bis Ihre Oberschenkel parallel sind, und senken Sie es dann langsam ab.",
  'ex_desc_66': "Stehen Sie mit Füßen schulterbreit auseinander. Legen Sie Ihre Arme vor die Brust, um Ihr Gleichgewicht zu halten.\n\nDann machen Sie eine Hocke, und wenn Sie hochkommen, treten Sie Ihr linkes Bein zur Seite. Wiederholen Sie die\nÜbung und wechseln Sie dann zum rechten Bein. Atmen Sie ein, wenn Sie untergehen, und atmen Sie aus, wenn Sie hochgehen. Ihre Knie sollten in einer Linie mit Ihren Zehen verlängert werden.\n\nEs ist eine großartige Übung für den Quadrizeps und den Gluteus maximus.",
  'ex_desc_67': "Legen Sie sich mit Armen an den Seiten, den Handflächen und den Beinen verlängert auf dem Rücken. Heben Sie Ihre Beine an und überqueren Sie den rechten Oberschenkel über links und dann die Übung um.\n\nstellen Sie sicher, dass Ihr Rücken immer flach ist.\n\nEs ist eine großartige Übung für die Obliques und\nRectus abdominis.",
  'ex_desc_68': "Legen Sie sich mit gebeugt und füßen auf dem Rücken auf dem Rücken auf dem Boden. Heben Sie dann ein Bein nach oben, während Sie Ihre Hüften so hoch wie möglich vom Boden heben.\n\ngehen zurück zur Startposition und wiederholen Sie mit der anderen Seite.",
  'ex_desc_69': "Legen Sie sich mit gebeugt und füßen auf dem Rücken auf dem Rücken auf dem Boden. Heben Sie dann ein Bein nach oben, während Sie Ihre Hüften so hoch wie möglich vom Boden heben.\n\ngehen zurück zur Startposition und wiederholen Sie mit der anderen Seite.",
  'ex_desc_70': "Beginnen Sie in einer Rallarmplankenposition mit Ihren Händen unter Ihren Schultern. Gehen Sie gleichzeitig mit den Händen und Füßen nach links. Machen Sie ein paar Schritte nach links, dann ein paar Schritte nach rechts. Wiederholen Sie die Übung.",
  'ex_desc_71': "Beginnen Sie mit Ihren Füßen schulterbreit auseinander. Biege deinen Körper und gehe mit deinen Händen vor dir, so weit du kannst, und gehe dann mit den Händen zurück.\n\nwiederholen Sie die Übung.",
  'ex_desc_72': "Beginnen Sie mit Ihren Füßen schulterbreit auseinander. Biegen Sie Ihre Beine leicht und lehnen Sie Ihren oberen Körper nach vorne.\n\nstellen Sie Ihre Hände vor sich, um das Gleichgewicht zu halten, und laufen Sie dann schnell.",
  'ex_desc_73': "Beginnen Sie in einer Hocke, wobei Ihre Hände Ihre Füße berühren. Springe hoch, breite deine Beine auseinander und hebe deine Arme über die Seiten. Kehren Sie zur Startposition zurück und machen Sie den nächsten Repräsentanten.",
  'ex_desc_74': "Beginnen Sie mit der Plankenposition.\n\nbringen ein Knie und den gegenüberliegenden Ellbogen hinein, um sich zu berühren, und bringen Sie sie zurück.\n\nwiederholen Sie mit der anderen Seite.",
  'ex_desc_75': "Beginnen Sie in der Plankenposition der geraden Arm mit Ihren Händen unter Ihren Schultern und Füßen zusammen. Springe deine Füße auseinander und lande auf den Zehen, dann hüpfe zurück. Wiederholen Sie die Übung.",
  'ex_desc_76': "Stellen Sie sich mit der Schulterbreite mit Ihren Füßen auseinander, legen Sie Ihre Hände auf den Boden und treten Sie Ihre Füße nach hinten.\n\nmachen einen schnellen Liegestütz und springen Sie dann hoch.",
  'ex_desc_77': "Stellen Sie sich mit Ihren Füßen schulterbreit und Ihre Hände auf Ihren Hüften.\n\ntreten Sie ein großes rückwärts mit Ihrem rechten Bein und senken Sie Ihren Körper, bis Ihr linker Oberschenkel parallel zum Boden ist.\n\nkehren Sie zurück und wiederholen Sie dies mit der anderen Seite.",
  'ex_desc_78': "Beginnen Sie in der Plankenposition. Verschieben Sie Ihren Körper\nhin und her.",
  'ex_desc_79': "Stellen Sie sich auf den Boden, legen Sie Ihre Hände vor sich und hüpfen Sie von Seite zur anderen.",
  'ex_desc_80': "Beginnen Sie zusammen mit Ihren Füßen und Händen, die über Ihrem Kopf angehoben werden.\n\nspringen Sie hoch, verteilen Sie Ihre Füße, senken Sie Ihre Hände und hocken Sie nach unten.\n\nspringen Sie zurück in die Startposition und machen Sie den nächsten Repräsentanten.",
  'ex_desc_81': "Beginnen Sie mit Ihren Händen unter Ihren Schultern, Ihrem linken Bein gebeugt und neben der Außenseite Ihres linken Arms und Ihr rechtes Bein streckte sich hinter Ihnen. Dann springen und die Beine in die Luft schalten.",
  'ex_desc_82': "Legen Sie Ihre Arme an Ihren Seiten und geben Sie vor, in jeder Hand einen Überspringseilgriff zu halten.\n\nspringen und abwechselnd auf den Kugeln Ihrer Füße landen und Ihre Handgelenke gleichzeitig rotieren, als würden Sie ein Seil drehen.",
  'ex_desc_83': "Beginnen Sie in der Squat -Position und springen Sie dann mit Ihren Bauchmuskeln zur Stärke nach oben.\n\nDiese Übung arbeitet Ihren Bauch.",
  'ex_desc_84': "Legen Sie mit Armen, die Ihren Körper stützen, auf den Boden. Hüpfen Sie vorwärts, bringen Sie Ihre Knie zu Ihrer Brust und steigen Sie dann zurück in die Startposition. Wiederholen Sie die Übung.",
  'ex_desc_85': "Beginnen Sie in der Plankenposition der geraden Arm. Biegen Sie dann Ihren rechten Arm und legen Sie Ihren Unterarm mit Ihrem Ellbogen unter Ihrer Schulter auf den Boden, beugen Sie Ihren linken Arm und kommen Sie in die traditionelle Plankenposition.\n\ndann rückte um und kehre zur Startposition zurück. Wiederholen Sie die Übung. Halten Sie Ihren Körper während der Übung gerade.\nAtme ein, wenn du runterkommst und ausatme, wenn du dich ankommst.\n\nEs ist eine großartige Übung für den Quadriceps, Trizeps\nund die Bauchmuskeln.",
  'ex_desc_86': "Stellen Sie sich mit Ihrem linken Bein auf dem Boden und Ihrem rechten Bein gerade und heben Sie an Ihrer rechten Seite an. Machen Sie einen kleinen Sprung und schwingen Sie Ihr linkes Bein zu Ihrer linken Seite. Schnell die Beine wechseln und wiederholen.",
  'ex_desc_87': "Beginnen Sie in der regulären Push-up-Position und lassen Sie Ihre Knie den Boden berühren und heben Sie Ihre Füße auf dem Boden. Schieben Sie Ihren Körper als nächstes auf und ab.",
  'ex_desc_88': "Laufen Sie mit jedem Schritt so hoch wie möglich mit den Knien. Halten Sie Ihren Oberkörper während dieser Übung aufrecht.",
  'ex_desc_89': "Stehen Sie mit Ihren Füßen schulterbreit auseinander. Legen Sie Ihre Hände auf den Boden und treten Sie Ihre Füße nach hinten, bringen Sie Ihre Füße zurück und springen Sie hoch.\n\nwiederholen Sie die Übung.",
  'ex_desc_90': "Stellen Sie sich mit Ihren Füßen zusammen und Ihren Armen an Ihren Seiten. Springe mit deinen Füßen und den Händen in der Form des Buchstabens \"X\".\n\nspringen Sie zurück, legen Sie Ihre Hände auf den Boden, treten Sie Ihre Beine rückwärts und verteilen Sie sie.\n\nkommen zur Startposition zurück und wiederholen Sie.",
  'ex_desc_91': "Setzen Sie sich auf einen Stuhl. Lehnen Sie sich leicht zurück, wobei Ihre Füße vom Boden abgehoben wurden. Heben Sie Ihr linkes Knie an und bringen Sie es in Ihren rechten Ellbogen. Seite wechseln und wiederholen.",
  'ex_desc_92': "Setzen Sie sich auf einen Stuhl und verwenden Sie Ihre rechte Hand, um den Rand des Stuhls zu halten. Drehen Sie Ihren Kopf zur linken Vorderseite und legen Sie Ihre linke Hand auf die rechte Seite Ihres\nKopfes. Ziehen Sie dann Ihren Kopf vorsichtig zur linken Seite. Halten Sie es für ein paar Sekunden.",
  'ex_desc_93': "Setzen Sie sich auf einen Stuhl und benutzen Sie Ihre linke Hand, um den Rand des Stuhls zu halten. Drehen Sie Ihren Kopf zur rechten vorderen Seite und legen Sie Ihre rechte Hand auf die linke Seite Ihres\nKopfes. Ziehen Sie dann Ihren Kopf vorsichtig zur rechten vorderen Seite. Halten Sie es für ein paar Sekunden.",
  'ex_desc_94': "Stehen Sie mit Ihren Füßen schulterbreit auseinander. Legen Sie Ihre Hände an die Wand, um das Gleichgewicht zu erhalten. Drehen Sie Ihre Knöchel, damit Ihre Zehen nach außen zeigen, und heben Sie Ihre Fersen auf und ab.",
  'ex_desc_95': "Stellen Sie sich mit Ihren Füßen schulterbreit auseinander und Ihre Hände hinter Ihren Ohren. Heben Sie Ihr rechtes Knie an und verwenden Sie Ihren linken Ellbogen, um Ihr rechtes Knie zu berühren.\nSeiten ändern und wiederholen.",
  'ex_desc_96': "Setzen Sie sich mit geradem Rücken auf einen Stuhl. Heben Sie Ihr linkes Knie langsam gerade nach oben und senken Sie es langsam nach unten.",
  'ex_desc_97': "Setzen Sie sich mit geradem Rücken auf einen Stuhl. Heben Sie Ihr rechtes Knie langsam gerade nach oben und senken Sie es langsam nach unten.",
  'ex_desc_98': "Beginnen Sie mit dem Rücken gegen die Wand und schieben Sie dann nach unten, bis sich Ihre Knie in einem Winkel von 90 Grad befinden. Halten Sie Ihren Rücken mit Händen und Armen von Ihren Beinen an der Wand an der Wand.\n\nhalten die Position.\n\nDie Übung soll die Quadrizepsmuskeln stärken.",
  'ex_desc_99': "Setzen Sie sich mit flacher Füße auf dem Boden direkt auf den Stuhl. Nehmen Sie die rechte Kante Ihres Stuhls mit Ihrer linken Hand. Geben Sie dann Ihren rechten Arm über Kopf und beugen Sie Ihren Körper nach links.\n\nhalten diese Position.",
  'ex_desc_100': "Stellen Sie sich mit Ihren Armen an Ihren Seiten. Rollen Sie Ihre Schultern in Richtung Ihrer Ohren, rollen Sie sie zurück und drücken Sie sie und rollen Sie sie nach unten. Wiederholen Sie die Übung.",
  'ex_desc_101': "Bringen Sie Ihr Kinn zu Ihrer Brust und halten Sie es ein paar Sekunden lang.\n\nschauen Sie dann zur Decke und halten Sie sie auch für einige Sekunden. Wiederholen Sie die\nÜbung.",
  'ex_desc_102': "Halten Sie einen Stuhl mit Ihrer rechten Hand, um das Gleichgewicht zu halten. Heben Sie Ihr linkes Bein so gut wie möglich an Ihre linke Seite. Rückkehr und wiederholen.",
  'ex_desc_103': "Legen Sie Ihre rechte Hand mit Ihrer Handfläche unter Ihren Oberschenkel. Halten Sie Ihre rechte Schulter flach. Legen Sie Ihre linke Hand auf die rechte Seite Ihres\nKopfes und ziehen Sie dann Ihren Kopf vorsichtig in Richtung links. Halten Sie es für ein paar Sekunden.",
  'ex_desc_104': "Legen Sie Ihre linke Hand mit Ihrer Handfläche unter Ihren Oberschenkel. Halten Sie Ihre linke Schulter flach. Legen Sie Ihre rechte Hand auf die linke Seite Ihres\nKopfes und ziehen Sie dann Ihren Kopf vorsichtig nach rechts. Halten Sie es für ein paar Sekunden.",
  'ex_desc_105': "Legen Sie Ihre rechte Hand auf den Rücken, schnappen Sie sich mit Ihrer linken Hand Ihren rechten Ellbogen und ziehen Sie ihn vorsichtig.\n\nhalten diese Position für eine Sekunden.",
  'ex_desc_106': "Legen Sie Ihre linke Hand auf den Rücken, schnappen Sie sich Ihre rechte Hand, um Ihren linken Ellbogen zu greifen und sie sanft zu ziehen.\n\nhalten diese Position für eine Sekunden.",
  'ex_desc_107': "Setzen Sie sich mit flacher Füße auf dem Boden direkt auf den Stuhl. Nehmen Sie die linke Kante Ihres Stuhls mit Ihrer rechten Hand. Geben Sie dann Ihren linken Arm über uns und beugen Sie Ihren Körper nach rechts.\n\nhalten diese Position.",
  'ex_desc_108': "Stehen Sie mit Ihren Füßen schulterbreit auseinander. Legen Sie Ihre linke Hand hinter Ihren Kopf und\nIhre rechte Hand an Ihrer Seite. Beugen Sie Ihren Körper auf Ihre rechte Seite und senken Sie Ihre rechte Hand in Richtung Boden.\n\nPause für eine Sekunde und kehre zum\nzurück",
  'ex_desc_109': "Stellen Sie sich einen großen Schritt vor einer Wand.\n\ndann leg Ihre Hände direkt zur Wand und lehnen Sie sich dagegen. Biegen Sie Ihre Ellbogen langsam und drücken Sie Ihren Oberkörper nach in Richtung Brunnen.\n\ndrücken und wiederholen Sie die Übung. Denken Sie daran, Ihren Körper gerade zu halten.",
  'ex_desc_110': "Stehen Sie mit Ihren Füßen 6-12 Zoll voneinander entfernt. Strecken Sie Ihre Arme vor sich. Senken Sie Ihren Körper, bis Ihre Oberschenkel parallel zu Boden sind. Kehren Sie zur Ausgangsposition zurück und wiederholen Sie die Übung.",
  'ex_desc_111': "Steh gerade mit den Füßen schulter auf. Legen Sie Ihre Hände auf beide Seiten Ihrer Taille, die Finger nach unten und die Ellbogen nach außen. Ziehen Sie Ihre Ellbogen vorsichtig nach hinten und bringen Sie sie dann zurück in die Ausgangsposition.\nwiederholen Sie die Übung.",
  'ex_desc_112': "Setzen Sie sich mit geradem Rücken auf einen Stuhl und Ihre Füße flach auf dem Boden. Nehmen Sie die Rückseite des Stuhls, atmen Sie tief ein und öffnen Sie Ihre Brust und Schultern. Halten Sie einige Sekunden lang für\nfest",
  'ex_desc_113': "Setzen Sie sich mit geradem Rücken auf den Rand eines Stuhls und strecken Sie Ihr linkes Bein mit Ihrer Ferse auf dem Boden und zeigen nach oben.\n\nerreichen beide Hände in Richtung Ihrer Zehen. Halten Sie diese Position für einige Sekunden.",
  'ex_desc_114': "Setzen Sie sich mit geradem Rücken auf den Rand eines Stuhls und verlängern Sie Ihr rechtes Bein vor Ihnen mit Ihrer Ferse auf dem Boden und zeigen nach oben.\n\nerreichen beide Hände in Richtung Ihrer Zehen. Halten Sie diese Position für einige Sekunden.",
  'ex_desc_115': "Stehen Sie mit Ihren Füßen schulterbreit auseinander. Legen Sie Ihre Hände hinter sich und verbinden Sie sie. Ziehen Sie dann Ihre Ellbogen zurück und strecken Sie Ihre Arme aus. Halten Sie es für ein paar Sekunden.",
  'ex_desc_116': "Bereiten Sie einen Stuhl vor, der ungefähr die Höhe Ihrer Knie ist, und legen Sie ihn direkt hinter sich. N\n\nstehen mit der Schulterbreite der Füße auseinander und strecken Sie Ihre Arme direkt. Dann senken Sie Ihren Körper und setzen Sie sich langsam in den Stuhl. Drücken Sie Ihre Gesäßmuskulatur und kehren Sie zu der stehenden Haltung zurück. Wiederholen Sie die Übung.",
  'ex_desc_117': "Halten Sie einen Stuhl mit Ihrer linken Hand, um das Gleichgewicht zu halten. Heben Sie Ihr rechtes Bein so weit wie möglich auf Ihre rechte Seite. Rückkehr und wiederholen.",
  'ex_desc_118': "Legen Sie sich auf Ihrer linken Seite, wobei der Kopf auf der linken Hand ruht. Heben Sie Ihr rechte Bein und drehen Sie Ihren Fuß in Kreisen.",
  'ex_desc_119': "Legen Sie sich auf der rechten Seite, wobei Ihr Kopf auf Ihrer rechten Hand ruht. Heben Sie dann Ihr linkes Bein an und drehen Sie Ihren Fuß in Kreisen.",
  'ex_desc_120': "Setzen Sie sich und überqueren Sie Ihre Beine auf die Matte. Heben Sie Ihren\nrechten Arm über uns und legen Sie Ihre linke Hand auf den Boden, um sie zu unterstützen.\n\nschauen Sie zu Ihrer rechten Hand und beugen Sie sich langsam Ihren linken Arm. Biegen Sie in der Zwischenzeit Ihren oberen Körper nach links. Halten Sie es für ein paar Sekunden.",
  'ex_desc_121': "Setzen Sie sich und überqueren Sie Ihre Beine auf die Matte. Heben Sie Ihren linken Arm über Kopf und legen Sie Ihre rechte Hand auf den Boden, um sie zu unterstützen.\n\nschauen Sie zu Ihrer linken Hand und beugen Sie sich langsam Ihren rechten Arm. Biegen Sie in der Zwischenzeit Ihren oberen Körper nach rechts. Halten Sie es für ein paar Sekunden.",
  'ex_desc_122': "Legen Sie sich auf Ihrer linken Seite, wobei Ihr Kopf auf Ihrem linken Arm und den Knien gebogen wird. Heben Sie Ihr rechtes Knie nach oben, während Sie Ihre Absätze berühren lassen, und kehren Sie dann zur Startposition zurück. Wiederholen Sie die Übung.",
  'ex_desc_123': "Legen Sie sich auf der rechten Seite, wobei Ihr Kopf auf Ihrem rechten Arm und den Knien gebogen wird. Heben Sie Ihr linkes Knie nach oben, während Sie Ihre Absätze berühren lassen, und kehren Sie dann zur Startposition zurück. Wiederholen Sie die Übung.",
  'ex_desc_124': "Legen Sie sich auf der rechten Seite, wobei Ihr Kopf auf Ihrer rechten Hand ruht.\n\ndann leg Ihren linken Fuß nach vorne auf den Boden. Heben Sie Ihr rechte Bein auf und ab.",
  'ex_desc_125': "Legen Sie sich auf Ihrer linken Seite, wobei der Kopf auf der linken Hand ruht.\n\ndann legen Sie Ihren rechten Fuß nach vorne auf den Boden.\n\nheben Sie Ihr linkes Bein auf und ab.",
  'ex_desc_128': "Setzen Sie sich auf den Boden, lehnen Sie sich dann zurück und heben Sie Ihre Beine vom Boden hoch. Heben Sie Ihren Oberkörper an und bringen Sie Ihre Knie zu Ihrer Brust. Dann ausdehnen und wiederholen.\n\nAtmen Sie aus, wenn Sie Ihren Körper heben und einatmen, wenn Sie sich ausdehnen. Es ist eine große Übung für den Unterbauchmuskel.",
  'ex_desc_129': "Legen Sie sich flach auf dem Boden und heben Sie Ihre Hüften vom Boden, während Sie Ihren Rücken gerade halten.\n\nhalten diese Position so lange wie möglich.\n\nDie Brückenübung stärkt den gesamten Bauch, den unteren Rücken und die Gesäßmuskulatur.",
  'ex_desc_130': "Legen Sie sich mit flacher Füße auf dem Rücken auf dem Boden. Legen Sie Ihren rechten Knöchel auf das linke Knie, die linke Hand hinter Ihr Ohr und den rechten Arm erstreckt sich bis zur Seite auf dem Boden. Heben Sie Ihre Schultern vom Boden ab, bringen Sie Ihren linken Ellbogen, um Ihr rechtes Knie zu treffen, und den rechten Arm in der Nähe Ihres Körpers und kehren Sie dann langsam zurück. Wiederholen Sie die Übung.",
  'ex_desc_131': "Legen Sie sich mit flacher Füße auf dem Rücken auf dem Boden. Legen Sie Ihren linken Knöchel auf Ihr rechtes Knie, die rechte Hand hinter Ihr Ohr und den linken Arm erstreckt sich bis zur Seite auf dem Boden. Heben Sie Ihre Schultern vom Boden ab, bringen Sie Ihren rechten Ellbogen, um Ihr linke Knie zu treffen, und den linken Arm in der Nähe Ihres Körpers und kehren Sie dann langsam zurück. Wiederholen Sie die Übung.",
  'ex_desc_132': "Legen Sie sich mit verlängerten Beinen und Ihrem Kinn auf Ihrem Bauch. Heben Sie Ihre Beine vom Boden ab und heben Sie dann abwechselnd Ihre linken und rechten Beine an.",
  'ex_desc_133': "Setzen Sie sich auf den Boden, heben Sie Ihre Beine in einem Winkel von 45 Grad hoch und lehnen Sie Ihren Oberkörper in einem Winkel von 45 Grad zurück.\n\nstrecken Sie Ihre Arme nach vorne.\n\nhalten diese Position.",
  'ex_desc_134': "Legen Sie sich mit gebeugtem Knien auf dem Bauch und\nAbsätze zusammengepresst.\n\ndann hebe deine Füße auf und ab. Die Übung ist sehr effektiv, um Ihren Hintern zu drücken.",
  'ex_desc_135': "Legen Sie sich mit gebogenen Knien auf dem Rücken, füßen flach auf dem Boden und Hände unter Ihren Hüften.\n\nerheben Sie Ihre Beine in die Tabletop -Position; Lassen Sie Ihren linken Fuß in Richtung Boden fallen. Tippen Sie mit Ihren Zehen auf den Boden; Dann heben Sie das Bein zurück. Seiten wechseln und die Übung wiederholen.",
  'ex_desc_136': "Legen Sie sich mit vollständig ausgedehnten Armen auf dem Boden auf den Boden und Ihre Daumen nach oben, Ihr Körper sollte in der Form des Buchstabens \"Y\" sein. Heben Sie Ihre Arme so weit wie möglich vom Boden aus und halten Sie sie 2 Sekunden lang an die Spitze. Gehen Sie langsam die Startposition zurück und wiederholen Sie die Übung. \n",
  'ex_desc_137': "Setzen Sie sich mit zusammen auf den Boden und schnappen Sie sich Ihre Zehen. Öffnen Sie Ihre Knie an den Seiten und drücken Sie Ihre Knie nach unten. Halte diese Position.",
  'ex_desc_138': "Legen Sie sich mit verlängerten Beinen auf den Rücken. Biege deine Knie und bring sie auf deine Brust; Umarme deine Knie mit beiden Händen. Ein paar Sekunden lang halten.",
  'ex_desc_139': "Legen Sie sich mit den Knien in einem Winkel von 90\nauf dem Rücken.\n\nstrecken Sie Ihre Arme an die Seiten und legen Sie Ihre Handflächen auf den Boden.\n\ndrehen Sie Ihre Beine nach links, während Sie Ihren Oberkörper an Ort und Stelle halten und Ihre Knie und Füße zusammen.\n\nhalten Sie es eine Sekunde lang, kehren Sie dann zurück und drehen Sie sich auf die andere Seite. Wiederholen Sie die Übung.",
  'ex_desc_140': "Beginnen Sie in einer Standardplankenposition. Drehen Sie Ihre Wirbelsäule auf Ihre linke Seite, bis Ihr linkes Bein den Boden berührt, und drehen Sie dann auf die andere Seite.\n\nwiederholen Sie die Übung.",
  'ex_desc_141': "Legen Sie sich auf dem Rücken mit den Händen an Ihren Seiten und Beinen auseinander. Hebe deine Beine und Arme vom Boden. Dann heben Sie Ihren Oberkörper und drücken Sie Ihre Arme und Knie zu Ihren Bauchmuskeln. Senken Sie Ihre Arme und Beine (aber berühren Sie den Boden nicht) und wiederholen Sie die Übung.",
  'ex_desc_142': "Beginnen Sie mit Ihren Knien unter Ihrem Hintern und Ihren Händen direkt unter Ihren Schultern. Heben Sie Ihr rechtes Bein nach hinten an und senken Sie es dann auf Ihre linke Seite. Heben Sie es erneut an und senken Sie es direkt nach unten.\n\nBitte lassen Sie Ihren rechten Fuß nicht den\nBoden berühren. Wiederholen Sie die Schritte.",
  'ex_desc_143': "Beginnen Sie mit Ihren Knien unter Ihrem Hintern und Ihren Händen direkt unter Ihren Schultern. Heben Sie Ihr linkes Bein nach hinten an und senken Sie es dann auf Ihre rechte Seite. Heben Sie es erneut an und senken Sie es direkt nach unten.\n\nBitte lassen Sie Ihren linken Fuß nicht den Boden berühren.\nwiederholen Sie die Schritte.",
  'ex_desc_145': "Halten Sie Ihre Unterarme in der Schulterhöhe zusammen und beugen Sie Ihre Ellbogen mit Ihren Händen zusammen, um eine Form zu erstellen.\n\ndann heben Sie Ihre Unterarme auf und ab.",
  'ex_desc_146': "Legen Sie sich mit geraden Beinen auf dem Bauch und strecken sich über den Kopf. Biegen Sie Ihre Ellbogen und ziehen Sie sie an Ihre Seiten hinunter. Kehren Sie zur Startposition zurück und wiederholen Sie dies.",
  'ex_desc_147': "Stehen Sie mit Ihren Füßen schulterbreit auseinander. Halten Sie eine Hantel in jeder Hand an Ihren Seiten. Heben Sie Ihre Arme mit Ihrem linken Arm vor sich und Ihrem rechten Arm auf Ihrer rechten Seite.\n\nkehren Sie zur Startposition zurück, wechseln Sie die Arme und wiederholen Sie dies.",
  'ex_desc_148': "Stehen Sie mit Ihren Füßen schulterbreit auseinander. Lehnen Sie sich nach vorne, beugen Sie sich leicht die Knie und setzen Sie Ihre Hüften zurück. Halten Sie eine Hantel in jeder Hand. Biegen Sie Ihre Ellbogen und ziehen Sie sie nach hinten. Senken Sie Ihre Hände und wiederholen Sie die Übung.",
  'ex_desc_149': "Legen Sie sich mit gebeugtem und flachen Füßen auf dem Rücken auf dem Rücken. Halten Sie eine Hantel in jeder Hand und heben Sie Ihre Arme zur Decke, wobei sich die Handflächen gegenseitig und Ihre Ellbogen leicht gebogen haben.\n\nDie Hanteln zu den Seiten senken, bis Ihre Oberarme den Boden berühren. Kehren Sie zurück und wiederholen Sie die Übung.",
  'ex_desc_150': "Legen Sie sich mit angehobenen Beinen auf dem Rücken, die Knie gebeugt und Fersen zusammengepresst. Legen Sie Ihre Arme flach an Ihre Seiten.\n\nglätten Sie Ihre Beine und bringen Sie sie zurück in die Ausgangsposition.\n\nwiederholen Sie die Übung.",
  'ex_desc_151': "Legen Sie sich mit Ihren Armen an Ihren Seiten auf dem Rücken. Heben Sie Ihre Beine an und halten Sie sie so gerad wie möglich.\n\nverbreiten Sie Ihre Beine und bringen Sie sie zurück.\nwiederholen Sie die Übung.",
  'ex_desc_152': "Legen Sie sich mit gebeugt und gehobenem Beinen auf dem Rücken. Führen Sie die Fahrradaktion mehrmals mit Ihren Beinen aus und kehren Sie sie dann um.",
  'ex_desc_153': "Beginnen Sie mit Ihren Händen unter Ihren Schultern, Ihr rechtes Knie direkt unter Ihrem Hintern und Ihr linkes Bein streckt und ruhte auf dem Boden. Heben Sie Ihr linkes Bein auf Ihre linke Seite. Kehren Sie zur Startposition zurück und wiederholen Sie die Übung.",
  'ex_desc_154': "Beginnen Sie mit Ihren Händen unter Ihren Schultern, Ihr linker Knie direkt unter Ihrem Hintern und Ihr rechte Bein streckt und ruhte auf dem Boden. Heben Sie Ihr rechtes Bein auf Ihre rechte Seite. Kehren Sie zur Startposition zurück und wiederholen Sie die Übung.",
  'ex_desc_155': "Legen Sie einen Arm über Ihren Körper, parallel zum Boden und ziehen Sie den anderen Arm, um den parallelen Arm zu Ihrer Brust zu ziehen.\n\nhalten eine Weile, wechseln Sie den Arm und wiederholen Sie die Übung.\n\nhalten den Innenarm während der Übung gerade.",
  'ex_desc_156': "Stehen Sie mit Ihrer rechten Hand an der Wand. Biegen Sie Ihr linkes Bein und erfassen Sie Ihren Knöchel oder Zehen, um Ihr linkes Kalb in der Nähe Ihres linken Oberschenkels zu bringen.\n\nhalten diese Position.",
  'ex_desc_157': "Stehen Sie mit Ihrer linken Hand an der Wand. Biegen Sie\nIhr rechtes Bein und greifen Sie Ihren Knöchel oder Zehen, um Ihr rechte Kalb nahe an Ihren rechten Oberschenkel zu bringen. Halte diese Position.",
  'ex_desc_158': "Stellen Sie sich einen großen Schritt vor eine Wand weg. Treten Sie mit Ihrem linken Fuß nach vorne und drücken Sie die Wand mit Ihren Händen.\n\nBitte stellen Sie sicher, dass Ihr rechtes Bein vollständig verlängert ist und Sie spüren, wie Ihr rechte Kalb dehnt.\n\nhalten diese Position für einige Sekunden.",
  'ex_desc_159': "Stellen Sie sich einen großen Schritt vor eine Wand weg. Treten Sie mit Ihrem rechten Fuß nach vorne und drücken Sie die Wand mit Ihren Händen.\n\nBitte stellen Sie sicher, dass Ihr linkes Bein vollständig verlängert ist und Sie spüren, wie sich Ihr linkes Kalb dehnt.\n\nhalten diese Position für einige Sekunden.",
  'ex_desc_160': "Beginnen Sie mit Ihren Knien und Händen auf dem Boden. Setzen Sie Ihre Hände ein wenig nach vorne, rücken Sie Ihre Knie und stecken Sie Ihre Zehen zusammen.\n\nAtme, atme dann aus und lehne dich zurück.\n\nVersuchen Sie, Ihren Hintern Ihre Fersen berühren zu lassen. Entspannen Sie Ihre Ellbogen, lassen Sie Ihre Stirn den Boden berühren und versuchen Sie, Ihre Brust nahe dem Boden zu senken.\n\nhalten diese Position.\n\nHalten Sie Ihre Arme nach vorne, während Sie sich zurücklehnen.\n\nstellen Sie sicher, dass während der Übung genügend Platz zwischen Ihren Schultern und Ohren ist.",
  'ex_desc_161': "Legen Sie sich mit Ihren Füßen zusammen auf dem Boden. Öffne deine Knie an den Seiten.\n\nhalten diese Position.",
  'ex_desc_162': "Legen Sie sich mit geraden Beinen auf dem Rücken und Ihren Armen an Ihren Seiten. Heben Sie Ihre Knie an und drehen Sie Ihre Beine nach rechts.\n\nhalten diese Übung.",
  'ex_desc_163': "Legen Sie sich mit geraden Beinen auf dem Rücken und Ihren Armen an Ihren Seiten. Heben Sie Ihre Knie an und drehen Sie Ihre Beine nach links.\n\nhalten diese Übung.",
  'ex_desc_164': "Beginnen Sie in der Plankenposition der geraden Arm. Heben Sie Ihren rechten Arm und Ihren linken Bein, bis sie parallel zum Boden sind.\nkehren zur Startposition zurück und wiederhole mit der anderen Seite.",
  'ex_desc_165': "Stehen Sie vor einem Stuhl. Dann steigen Sie auf den\nStuhl und treten Sie zurück.\n\nDie Übung arbeitet, um die Beine und das Gesäßteil zu stärken.",
  'ex_desc_166': "Setzen Sie sich auf eine Bank, legen Sie Ihre Hände hinter sich und schnappen Sie sich die Bank, lehnen Sie sich Ihren Körper nach hinten. Heben Sie Ihre Beine an, beugen Sie die Knie und bringen Sie die Knie zu Ihrer Brust. Erweitern Sie Ihre Beine vollständig und wiederholen Sie dies.",
  'ex_desc_167': "Finden Sie eine Tür, nehmen Sie eine Longe -Position in der Tür mit Ihren Armen am Türrahmen und Ihren Ellbogen etwas tiefer als Ihre Schultern und bringen Sie dann langsam Ihre Brust nach vorne.\n\nhalten diese Position für 30-40 Sekunden. Dann kommen Sie langsam heraus, bringen Sie Ihre Arme runter und machen Sie ein paar Schulterrollen. Ziehen Sie Ihren Kopf nicht nach vorne und halten Sie Ihren Nacken entspannt.",
  'ex_desc_168': "Legen Sie sich mit verlängerten Beinen auf dem Rücken. Heben Sie Ihr rechtes Bein nach oben und ziehen Sie mit Ihrer linken Hand Ihr rechtes Knie nach links, aber halten Sie Ihren anderen Arm auf dem Boden bis zur Seite.\n\nhalten diese Position für einige Sekunden.",
  'ex_desc_169': "Legen Sie sich mit verlängerten Beinen auf dem Rücken. Heben Sie Ihr linkes Bein nach oben und ziehen Sie mit Ihrer rechten Hand\n, um Ihr linkes Knie nach rechts zu ziehen, aber halten Sie Ihren anderen Arm auf dem Boden bis zur Seite.\n\nhalten diese Position für einige Sekunden.",
  'ex_desc_170': "Beginnen Sie in einer Push-up-Position. Bringen Sie Ihr linkes Knie nach vorne und lassen Sie Ihr rechtes Knie auf den Boden fallen. Erhöhen Sie Ihren Oberkörper und legen Sie Ihre Hände auf Ihre Taille. Schieben Sie Ihre Hüften nach vorne, während Sie Ihren Oberkörper gerade halten.\n\nBitte stellen Sie sicher, dass Ihr Frontknie nicht über Ihre Zehen geht.\n\nhalten diese Position für einige Sekunden.",
  'ex_desc_171': "Beginnen Sie in einer Push-up-Position. Bringen Sie Ihr rechtes Knie nach vorne und lassen Sie Ihr linke Knie auf den Boden fallen. Erhöhen Sie Ihren Oberkörper und legen Sie Ihre Hände auf Ihre Taille. Schieben Sie Ihre Hüften nach vorne, während Sie Ihren Oberkörper gerade halten.\n\nBitte stellen Sie sicher, dass Ihr Frontknie nicht über Ihre Zehen geht.\n\nhalten diese Position für einige Sekunden.",
  'ex_desc_172': "Stellen Sie sich mit den Händen auf den Boden auf Ihre Hüften und Ihre Füße schulterbreit. Heben Sie Ihr linkes Bein auf Taille auf und beugen Sie sich in Ihrem Knie in einem rechten Winkel.\n\ndrehen Sie Ihren Körper zur linken Seite und\n\nzurück. Ändern Sie die Seiten und wiederholen Sie die\nÜbung.\n\nhalten die Zehen Ihres stehenden Beins nach vorne. Ihre Knie sollten der gleichen Richtung wie Ihre Zehen ausgesetzt sein.",
  'ex_desc_173': "Stellen Sie sich auf den Boden, beugen Sie Ihre Beine leicht und lehnen Sie Ihren Oberkörper nach vorne.\n\ndann nach rechts springen. Wenn Sie springen, bringen Sie Ihren linken Fuß hinter sich und Ihren linken Arm vor Ihnen.\n\ndann springen Sie zur anderen Seite. Wiederholen Sie die Übung.",
  'ex_desc_174': "Stellen Sie sich mit Ihren Füßen schulterbreit auseinander und\nlegen Ihren dominanten Fuß leicht nach vorne. Beugen Sie Ihre Knie leicht, drehen Sie Ihre Fäuste und beugen Sie Ihre Ellbogen bei 90 Grad. Heben Sie Ihren rechten Arm in die Schulterhöhe und halten Sie Ihren Unterarm parallel zum Boden. Drehen Sie Ihre\nSchultern und Hüften und schlagen Sie nach links.\nwechseln Sie die Seiten und wiederholen Sie dies.",
  'ex_desc_175': "Legen Sie mit Armen, die Ihren Körper stützen, auf den Boden. Halten Sie Ihren Körper gerade, während Sie Ihren Körper mit Ihren Armen erhöhen und den Körper senken.\n\nDiese Übung arbeitet die Brust, Schultern, Trizeps,\nRücken und Beine.",
  'ex_desc_176': "Beginnen Sie in der Liegestütze. Gehen Sie dann für einen Liegestütz hinunter und drehen Sie Ihren oberen Körper und verlängern Sie Ihren rechten Arm nach oben.\n\nwiederholen Sie die Übung mit dem anderen Arm. Es ist eine großartige Übung für Brust, Schultern, Arme und Kern.",
  'ex_desc_177': "Legen Sie sich auf Ihrer rechten Seite mit Ihrem Unterarm, der Ihren Körper stützt. Halten Sie Ihren Körper in einer geraden Linie.\n\nDiese Übung zielt auf die Bauchmuskeln und\nobliques ab.",
  'ex_desc_178': "Legen Sie sich auf Ihrer linken Seite mit Ihrem Unterarm, der Ihren Körper unterstützt. Halten Sie Ihren Körper in einer geraden Linie.\n\nDiese Übung zielt auf die Bauchmuskeln und\nobliques ab.",
  'ex_desc_179': "Legen Sie sich mit gebogenen Knien auf dem Rücken auf dem Boden. Legen Sie Ihre Arme direkt über den Kopf. Heben Sie Ihren Oberkörper vom Boden ab und kehren Sie langsam zur Startposition zurück. Die Übung erhöht die Abdominalausdauer.",
  'ex_desc_180': "Stehen Sie mit Ihren Füßen schulterbreit auseinander und\nIhre Knie leicht gebogen. Heben Sie Ihre Arme mit Ihren Ellbogen\ngebogen.\n\nverdrehen Sie Ihren Oberkörper nach links und dann die\nrechts.",
  'ex_desc_181': "Legen Sie sich mit geraden Beinen auf dem Rücken und\nIhre Hände an Ihren Seiten. Heben Sie Ihr rechtes Bein zur Decke an. Halten Sie mit Ihren Händen den Rücken Ihres Oberschenkels.\nbehalten Sie diese Position.",
  'ex_desc_182': "Legen Sie sich mit geraden Beinen auf dem Rücken und\nIhre Hände an Ihren Seiten. Heben Sie Ihr linkes Bein zur Decke. Halten Sie mit Ihren Händen den Rücken Ihres Oberschenkels.\nbehalten Sie diese Position.",
  'ex_desc_183': "Stellen Sie sich mit den Armen auf dem Boden, um an der Schulterhöhe an Ihren Seiten auszustrecken.\n\nbeugen Sie Ihren Körper und berühren Sie Ihre linke Hand, um Ihren rechten Fuß zu berühren oder so gut wie möglich zu werden. Seiten wechseln und wiederholen.\n\nAtmen Sie aus, wenn Sie Ihren Körper biegen und einatmen, wenn Sie aufkommen.\n\nhalten Sie Ihren Rücken und Ihre Beine während der Übung gerade.",
  'ex_desc_184': "Stell mit deinen Händen in deiner Taille. Heben Sie Ihr linkes Bein an und bewegen Sie es im Uhrzeigersinn in großen Kreisen und bewegen Sie es gegen den Uhrzeigersinn.\nSchalten Sie die Beine und wiederholen Sie die Übung.",
  'ex_desc_185': "Legen Sie sich auf Ihrer linken Seite, wobei Ihr Kopf auf Ihrem linken Arm ruht. Biege deine Knie in einem Winkel von 90 Grad in der Vorderseite von dir.\n\nbegradigen Sie Ihr rechtes Bein und heben Sie es gerade auf und ab.",
  'ex_desc_186': "Legen Sie sich auf der rechten Seite, wobei Ihr Kopf auf Ihrem rechten Arm ruht. Biege deine Knie in einem Winkel von 90 Grad in der Vorderseite von dir.\n\nstrecken Sie Ihr linkes Bein und heben Sie es gerade auf und ab.",
  'ex_desc_187': "Legen Sie ein Kissen am Boden der Wand. Lügen Sie auf dem Rücken, heben Sie und legen Sie Ihre Beine auf die Wand. Bewegen Sie Ihre Hüften auf das Kissen, so nah an der Wand wie möglich. Halte diese Position.",
  'ex_desc_188': "Stellen Sie sich auf den Boden, beugen Sie dann Ihr linkes Bein und greifen Sie Ihren Knöchel oder Zehen, um Ihr linkes Kalb in der Nähe Ihres linken Oberschenkels zu bringen.\n\nhalten diese Position für einige Sekunden, dann\n\nändern die Seiten und wiederholen Sie dies.\n\nIhr angehobenes Knie sollte immer gerade runtergehen, und Ihr Oberkörper sollte während der Übung gerade bleiben.",
  'ex_desc_190': "Legen Sie sich mit verlängerten Beinen auf dem Boden. Heben Sie Ihr rechtes Knie hoch und schnappen Sie es sich mit beiden Händen. Ziehen Sie Ihr rechtes Knie so viel wie möglich zu Ihrer Brust, während Sie Ihr linkes Bein gerade auf dem Boden halten.\n\nhalten diese Position für einige Sekunden.",
  'ex_desc_191': "Legen Sie sich mit verlängerten Beinen auf dem Boden. Heben Sie Ihr linkes Knie hoch und schnappen Sie es sich mit beiden Händen. Ziehen Sie Ihr linkes Knie so viel wie möglich zu Ihrer Brust, während Sie Ihr rechte Bein gerade auf dem Boden halten.\n\nhalten diese Position für einige Sekunden.",
  'ex_desc_192': "Beginnen Sie mit Ihrem linken Knie und Ihren Händen auf einer Bank und legen Sie Ihre Hände direkt unter Ihre Schultern.\n\ndann treten Sie Ihr rechtes Bein zurück, bis es parallel\nmit dem Boden ist. Kehren Sie zur Ausgangsposition zurück und wiederholen Sie die Übung.",
  'ex_desc_193': "Beginnen Sie mit Ihrem rechten Knie und Ihren Händen auf einer Bank und legen Sie Ihre Hände direkt unter Ihre Schultern.\n\ndann treten Sie Ihr linkes Bein zurück, bis es parallel zu\nauf dem Boden ist. Kehren Sie zur Ausgangsposition zurück und wiederholen Sie die Übung.",
  'ex_desc_194': "Setzen Sie sich mit Ihren Beinen vor Ihnen.\nBiegen Sie Ihr linkes Bein mit Ihrem linken Fuß schließen\nam rechten Oberschenkel.\n\nlehnen Sie Ihren Oberkörper nach vorne. Halten Sie diese Position.",
  'ex_desc_195': "Setzen Sie sich mit Ihren Beinen vor Ihnen.\nBiegen Sie Ihr rechtes Bein mit Ihrem rechten Fuß in der Nähe Ihres linken Oberschenkels.\n\nlehnen Sie Ihren Oberkörper nach vorne. Halten Sie diese Position.",
  'ex_desc_196': "Stellen Sie sich mit Ihren Füßen zusammen auf den Boden. Biegen Sie dann Ihren Körper und bringen Sie Ihren oberen Körper so nah wie möglich an Ihren Beinen.\n\nhalten diese Position für einige Sekunden und\nwiederholen.\n\nAtmen Sie aus, wenn Sie Ihren Körper biegen und einatmen, wenn Sie aufkommen. Halten Sie Ihre Beine während der Übung gerade.",
  'ex_desc_197': "Beginnen Sie mit Ihren Knien unter Ihrem Hintern und Ihren Händen direkt unter Ihren Schultern. Geben Sie Ihre Beine und heben Sie Ihre Hüften in einer verkehrten 'V' -Form hoch. Verteilen Sie Ihre Füße und verteilen Sie Ihre Finger. Übertragen Sie Ihr Gewicht zurück zu Ihren Beinen. Halten Sie diese Position.",
  'ex_desc_198': "Beginnen Sie mit Ihren Knien unter Ihrem Hintern und Ihren Händen unter Ihren Schultern. Bringen Sie Ihr rechtes Knie nach vorne, legen Sie Ihren\nrechten Fuß auf den Boden zwischen Ihrer linken Hand und dem linken Knie und lassen Sie Ihr rechtes Knie nahe an Ihrem rechten Handgelenk am Boden fallen.\n\nschieben Sie Ihr linkes Bein nach hinten. Legen Sie Ihre\nUnterarme auf den Boden vor Ihr Bein, mit auseinander geraten und Ihre Handflächen sind zu gegenseitig. Ein paar Sekunden lang halten.",
  'ex_desc_199': "Beginnen Sie mit Ihren Knien unter Ihrem Hintern und Ihren Händen unter Ihren Schultern. Bringen Sie Ihr linkes Knie nach vorne, legen Sie Ihren linken Fuß auf den Boden zwischen Ihrer rechten Hand und dem rechten Knie und lassen Sie Ihr linkes Knie nahe am linken Handgelenk am Boden fallen.\n\nschieben Sie Ihr rechtes Bein nach hinten. Legen Sie Ihre\nUnterarme auf den Boden vor Ihr Bein, mit auseinander geraten und Ihre Handflächen sind zu gegenseitig. Ein paar Sekunden lang halten.",
  'ex_desc_200': "Steh mit deinen Armen an deinen Seiten auf. Überqueren Sie Ihr linkes Bein hinter Ihrem rechten Bein.\n\nverlängern Sie beide Arme über Ihren Kopf, fassen Sie Ihre linke Handfläche mit Ihrer rechten Hand und ziehen Sie sie auf Ihre rechte Seite. Beugen Sie Ihren Oberkörper auf Ihre rechte Seite.\nhalten einige Sekunden lang.",
  'ex_desc_201': "Steh mit deinen Armen an deinen Seiten auf. Überqueren Sie Ihr rechtes Bein hinter Ihrem linken Bein.\n\nverlängern Sie beide Arme über Ihren Kopf, erfassen Sie Ihre\nrechte Handfläche mit Ihrer linken Hand und ziehen Sie sie an Ihre linke Seite. Beugen Sie Ihren Oberkörper zu Ihrer linken Seite.\nhalten einige Sekunden lang.",
  'ex_desc_202': "Stellen Sie sich vor einer Wand mit etwas breiter als die Schulterbreite und Ihre Hüften gegen die Wand. Biege deine Knie, um eine 1/4 -Hocke zu machen, und kehre dann zur Startposition zurück. Wiederholen Sie die\nÜbung.",
  'ex_desc_203': "Setzen Sie sich mit geradem Rücken auf einen Stuhl. Langsam verlängern Sie Ihr rechtes Bein, bis es gerade ist, und\nparallel zum Boden und senkt es langsam nach unten.\nwiederholen Sie die Übung.",
  'ex_desc_204': "Setzen Sie sich mit geradem Rücken auf einen Stuhl. Langsam verlängern Sie Ihr linkes Bein, bis es gerade ist, und\nparallel zum Boden und senkt es dann langsam ab. Wiederholen Sie die Übung.",
  'ex_desc_205': "Legen Sie sich auf der rechten Seite mit Ihren Händen auf dem Boden, um Unterstützung zu erhalten. Stellen Sie eine Schaumstoffwalze unter die seitliche Seite Ihres rechten Oberschenkels und legen Sie Ihren linken Fuß nach vorne auf den Boden. Rollen Sie den Oberschenkel von Ihrer Hüfte zu Ihrem Knie hin und her.",
  'ex_desc_206': "Legen Sie sich auf Ihrer linken Seite mit den Händen auf dem Boden, um Unterstützung zu erhalten. Stellen Sie eine Schaumstoffwalze unter die seitliche Seite Ihres linken Oberschenkels und legen Sie Ihren rechten Fuß auf den Boden. Rollen Sie den Oberschenkel zurück und\nweiter von Ihrer Hüfte bis zu Ihrem Knie.",
  'ex_desc_207': "Legen Sie auf dem Boden mit den Unterarmen, die auf dem Boden und den Handflächen heruntergekommen sind. Legen Sie eine Schaumstoffwalze unter Ihre Oberschenkel und heben Sie Ihre\nFuß vom Boden. Rollen Sie den Quadrizeps von\nIhre Hüfte auf die Knie hin und her.",
  'ex_desc_208': "Setzen Sie sich auf den Boden mit den Beinen vor Ihnen. Legen Sie eine Schaumstoffwalze unter Ihre Oberschenkel und legen Sie die Hände hinter sich auf den Boden, um sie zu unterstützen. Heben Sie Ihre Füße vom Boden ab und rollen Sie Ihre\nSehne von Ihren Hüften zu den Knien hinten und fort.",
  'ex_desc_209': "Setzen Sie sich auf den Boden mit den Beinen vor Ihnen. Legen Sie eine Schaumstoffwalze unter Ihre Knie, und legen Sie Ihre Hände hinter Sie auf den Boden, um zu unterstützen. Heben Sie Ihren rechten Fuß langsam an und glätten Sie Ihr Bein so viel wie möglich. Dann langsam senken. Wiederholen Sie die Übung.",
  'ex_desc_210': "Setzen Sie sich auf den Boden mit den Beinen vor Ihnen. Legen Sie eine Schaumstoffwalze unter Ihre Knie, und legen Sie Ihre Hände hinter Sie auf den Boden, um zu unterstützen. Heben Sie Ihren linken Fuß langsam an und glätten Sie Ihr Bein so viel wie möglich. Dann langsam senken. Wiederholen Sie die Übung.",
  'ex_desc_211': "Legen Sie sich mit gebeugt und füben auf dem Rücken auf dem Boden auf dem Boden. Wenn Sie Ihren unteren Rücken auf dem Boden flachen, um die Lücke zwischen Ihrem unteren Rücken und\nauf dem Boden zu beseitigen, kehren Sie dann zur Ausgangsposition zurück.\n\nwiederholen Sie die Übung.",
  'ex_desc_212': "Geh langsam. Legen Sie Ihre Ferse auf den Boden, rollen Sie vollständig durch den Fuß zu Ihren Zehen und schieben Sie sich dann mit Ihren Zehen nach vorne.",
  'ex_desc_213': "Mit Armen gegen eine Wand stehen. Legen Sie Ihren rechten Fuß am linken Knöchel und heben Sie Ihre linke Ferse nach oben und unten.",
  'ex_desc_214': "Mit Armen gegen eine Wand stehen. Legen Sie Ihren linken Fuß auf Ihren rechten Knöchel und heben Sie Ihre rechte Ferse hoch und runter.",
  'ex_desc_215': "Beginnen Sie in der Push-up-Position, aber halten Sie Ihre\nArme gerade. Diese Übung stärkt\nIhren Bauch- und Rückenmuskeln.",
  'ex_desc_216': "Lügen Sie auf Ihrer linken Seite. Legen Sie Ihren linken Ellbogen direkt unter Ihre Schultern und legen Sie Ihre rechte Hand auf Ihre Taille. Legen Sie Ihr rechtes Bein auf Ihr linkes Bein.\n\nerhöhen Sie Ihre Hüften nach oben, halten Sie 2-4\nSekunden und kehren Sie dann zur Startposition zurück.\n\nwiederholen Sie diese Übung.",
  'ex_desc_217': "Lügen Sie auf Ihrer rechten Seite. Legen Sie Ihren rechten Ellbogen direkt unter Ihre Schultern und legen Sie Ihre linke Hand auf Ihre Taille. Legen Sie Ihr linkes Bein auf Ihr rechte Bein.\n\nerhöhen Sie Ihre Hüften nach oben, halten Sie 2-4\nSekunden und kehren Sie dann zur Startposition zurück.\n\nwiederholen Sie diese Übung.",
  'ex_desc_218': "Beginnen Sie in einer traditionellen Plankenposition und verlängern Sie abwechselnd einen Arm nach vorne. Halten Sie Ihren Körper während der Übung gerade.\n\nEs ist eine großartige Übung für den Bauchmuskel und den Deltamuskel.",
  'ex_desc_219': "Beginnen Sie in einer rechten Plankenposition, heben Sie dann Ihr Oberbein an und treten Sie es nach vor. Kehren Sie zu\nder Startposition zurück und wiederholen Sie dies. Halten Sie Ihre Hüften nicht und halten Sie während der Übung Ihre Beine und den Oberkörper gerade.\n\nAtme aus, wenn dein Bein rauskommt und einatme\n, wenn dein Bein zurückkommt.\n\nEs ist eine großartige Übung für den Gluteus und den Quadrizeps.",
  'ex_desc_220': "Beginnen Sie in einer linken Side -Plankposition, heben Sie dann Ihr Oberbein an und treten Sie es nach vor. Kehren Sie zu\nder Startposition zurück und wiederholen Sie dies. Halten Sie Ihre Hüften nicht und halten Sie während der Übung Ihre Beine und den Oberkörper gerade.\n\nAtme aus, wenn dein Bein rauskommt und einatme\n, wenn dein Bein zurückkommt.\n\nEs ist eine großartige Übung für den Gluteus und den Quadrizeps.",
  'ex_desc_221': "Setzen Sie sich mit gebogenen Beinen auf den Boden, die Hüften nach oben und die Finger zeigen nach vorne unter Ihren Schultern.\n\ntreten Sie Ihre Füße in die Luft, die links abwechselt und\nrechts.",
  'ex_desc_222': "Legen Sie sich mit Ihren Händen hinter Ihren Ohren auf dem Rücken. Heben Sie dann Ihren Oberkörper vom Boden und langsam bis zur Sitzposition. Ziehen Sie nicht den Hals, wenn Sie aufstehen. Gehen Sie langsam zur Startposition zurück und wiederholen Sie die Übung. Wenn Ihre Wirbelsäule weh tut, wechseln Sie bitte zu einem anderen Training.",
  'ex_desc_223': "Legen Sie sich mit Ihren Händen auf dem Rücken an Ihren Seiten und Beinen direkt zur Decke.\n\nerheben Sie Ihre Hüften direkt vom Boden und kehren Sie dann zur Ausgangsposition zurück.\n\nwiederholen Sie die Übung.",
  'ex_desc_224': "Stehen Sie mit Ihren Füßen schulterbreit auseinander. Legen Sie Ihre Hände auf den Boden und treten Sie Ihre Füße nach hinten. Beugen Sie Ihr rechtes Knie in Richtung Ihrer Brust und halten Sie Ihr linkes Bein gerade und wechseln Sie schnell zu Ihrem linken Bein.\n\ntreten Sie Ihren linken Fuß nach hinten und springen Sie dann hoch. Wiederholen Sie die Übung.",
  'ex_desc_225': "Beginnen Sie in der Liegeposition mit gebogenen Knien und leicht voneinander getrennten Füßen. Platziere deine Hände hinter deine Ohren. Heben Sie Ihren Oberkörper nach oben und drehen Sie sich zur Seite. Senken Sie es langsam wieder in die Ausgangsposition zurück. Wiederholen Sie mit der anderen Seite.",
  'ex_desc_226': "Legen Sie sich mit Ihren Beinen direkt zur Decke und den Händen an Ihren Seiten.\n\nSichten Sie eine Ihrer Beine ab. Wenn Sie es erhöhen, heben Sie Ihre Hüften vom Boden hoch.\n\nkehren zur Ausgangsposition zurück. Wechseln Sie zum anderen Bein und wiederholen Sie die Übung.",
  'ex_desc_227': "Setzen Sie sich mit Ihren Handflächen hinter Ihren Hüften auf dem Boden an Ihren Seiten.\n\nverlängern Sie Ihre Beine und erhöhen Sie sie vom Boden. Bewegen Sie Ihre Beine gegen den Uhrzeigersinn in Kreisen.",
  'ex_desc_228': "Stellen Sie sich mit den Armen auf dem Boden, die sich in der Schulterhöhe direkt an die Seiten erstrecken.\n\nbewegen Sie Ihre Arme im Uhrzeigersinn schnell.\n\nVersuchen Sie, es so schnell wie möglich zu tun. Es ist eine großartige Übung für den Deltamuskel.",
  'ex_desc_229': "Legen Sie sich auf Ihrer linken Seite mit Ihrem Unterarm, der Ihren Körper und Ihre Knie auf den Boden gebeugt.\n\nhalten Sie Ihre Wirbelsäule gerade. Halte diese Position.",
  'ex_desc_230': "Legen Sie sich auf der rechten Seite mit Ihrem Unterarm, der Ihren Körper und Ihre Knie auf den Boden gebeugt.\n\nhalten Sie Ihre Wirbelsäule gerade. Halte diese Position.",
  'ex_desc_231': "Stellen Sie sich mit den Armen auf dem Boden, die in der Schulterhöhe direkt zur Seite ausgefallen sind.\n\nbewegen Sie Ihre Arme gegen den Uhrzeigersinn in großen Kreisen.\n\nVersuchen Sie, es so schnell wie möglich zu tun.\n\nEs ist eine großartige Übung für den Deltamuskel.",
  'ex_desc_232': "Lehnen Sie sich nach vorne, beugen Sie Ihre Knie und Ellbogen.\n\nstrecken Sie Ihre Arme hinter sich und drücken Sie Ihren\nTrizeps. Bitte machen Sie Ihre Arme parallel zum Boden, wenn Sie sie ausdehnen. Gehen Sie zurück zur Startposition und wiederholen Sie diese\nÜbung.",
  'ex_desc_233': "Setzen Sie sich mit gebogenen Beinen zusammen, legen Sie Ihre Hände\nschulterbreit auf den Boden hinter sich,\nund stellen Sie sicher, dass Ihre Finger seitlich gegenüberstehen. Heben Sie Ihre Hüften an, bis Ihr Oberkörper parallel zum Boden ist und mit Ihren Händen und den Meter nach vorne gehen.",
  'ex_desc_234': "Stehen Sie aufrecht mit Ihren Füßen, sollte sich auseinandersetzen. Strecken Sie Ihre Arme in der Schulterhöhe mit einem Arm in der Form des Buchstabens \"X\" und verteilen Sie sie dann auseinander.\n\nwechseln die Arme und wiederholen Sie die Übung.",
  'ex_desc_235': "Beginnen Sie in der Plankenposition der geraden Arm. Heben Sie Ihre rechte Hand an, um auf Ihre linke Schulter zu klopfen.\n\nkehren zur Startposition zurück und wiederhole mit\ndie andere Hand.",
  'ex_desc_236': "Stellen Sie sich mit Ihrem rechten Arm nahe an einer Wand. Erweitern Sie Ihren rechten Arm und legen Sie Ihre rechte Hand an die Wand, drehen Sie dann Ihren Körper vorsichtig nach links.",
  'ex_desc_237': "Stehen Sie mit Ihrem linken Arm in der Nähe einer Wand. Erweitern Sie Ihren linken Arm und legen Sie Ihre linke Hand an die Wand, um Ihren Körper vorsichtig nach rechts zu drehen.",
  'ex_desc_238': "Stellen Sie sich mit der Schulterbreite Ihrer Füße auf dem Boden. Strecken Sie Ihre Arme in der Schulterhöhe nach vorne, wobei sich die Handflächen gegenseitig zugewandt haben.\n\nstrecken Sie Ihre Arme so weit wie möglich aus und bewegen Sie sie dann zurück nach vorne. Wiederholen Sie die Übung.",
  'ex_desc_239': "Halten Sie Ihre Hände zusammen und heben Sie sie über uns. Bewegen Sie dann Ihre Arme gegen den Uhrzeigersinn in großen Kreisen.",
  'ex_desc_240': "Halten Sie Ihre Hände zusammen und heben Sie sie über den Kopf. Bewegen Sie dann Ihre Arme im Uhrzeigersinn in großen Kreisen.",
  'ex_desc_241': "Stellen Sie sich mit Ihren Händen vor eine Wand an der Wand. Treten Sie langsam zurück und schieben Sie Ihre Hände nach unten, bis Ihr Oberkörper parallel zum Boden ist. Schieben Sie Ihre Hände nach vorne in die Wand\n, während Sie Ihre Hüften von der Wand wegziehen.\nÜbertragen Sie Ihr Gewicht in Ihre Füße. Halten Sie diese Position.",
  'ex_desc_242': "Setzen Sie sich mit gebogenen Knien und Ihren Füßen flach auf dem Boden. Legen Sie Ihre Hände hinter sich auf den Boden und halten Sie Ihre Finger rückwärts. Biegen Sie Ihre Ellbogen leicht, um die Dehnung vor Ihren Schultern zu spüren.",
  'ex_desc_243': "Beginnen Sie in der Liegeposition, wobei sich die Beine erstrecken und die Arme an Ihren Seiten. Heben Sie gleichzeitig Ihr linkes Bein und Ihren Oberkörper vom Boden hoch und berühren Sie Ihre Zehen. Wiederholen Sie mit dem anderen Bein.",
  'ex_desc_244': "Setzen Sie sich mit Ihren Handflächen hinter Ihren Hüften auf dem Boden an Ihren Seiten.\n\nverlängern Sie Ihre Beine und erhöhen Sie sie vom Boden. Bewegen Sie Ihre Beine im Uhrzeigersinn in Kreisen.",
  'ex_desc_245': "Setzen Sie sich auf den Boden mit zusammengebogenen Beinen und Ihren Händen unter Ihren Schultern, um Ihren Körper zu unterstützen. Heben Sie dann ein Bein nach oben, während Sie Ihre Hüften so hoch wie möglich vom Boden abheben. Wechseln Sie zum anderen Bein und wiederholen Sie. Schieben Sie sich mit Ihren Hüften anstelle Ihres Rückens hoch. Es ist eine großartige Übung für den Gluteus.",
  'ex_desc_246': "Legen Sie sich mit Ihren Armen auf dem Bauch. Heben Sie abwechselnd Ihre gegenüberliegende SRM und Bein.",
  'ex_desc_247': "Setzen Sie sich und überqueren Sie Ihre Beine auf die Matte. Legen Sie Ihre linke Hand auf Ihr rechtes Knie und Ihre rechte Hand hinter sich auf dem Boden.",
  'ex_desc_248': "Setzen Sie sich und überqueren Sie Ihre Beine auf die Matte. Legen Sie Ihre rechte Hand auf das linke Knie und Ihre linke Hand hinter sich auf dem Boden. Drehen Sie Ihren Oberkörper langsam nach links. Halten Sie es für ein paar Sekunden.",

