  ///  Plan Introduction Strings
  'plan_introduction_1': "3-10 min effizientes Training helfen Ihnen, Fett zu verlieren und fit zu bleiben. Erreichen Sie Ihr Gewichtsverlustziel schnell!",
  'plan_introduction_2': "5-15 Minuten einfache Workouts, um Ihren Hintern festzuziehen und zu heben. Holen Sie sich in kürzester Zeit einen gut geformten Hintern!",
  'plan_introduction_3': "Verlieren Sie Bauchfett und flachen Sie Ihren Bauch mit unseren kurzen und effektiven Trainingseinheiten zu Hause! Sie werden in nur wenigen Wochen einen flachen Bauch bekommen!",
  'plan_introduction_4': "Diese Workouts haben nachweislich, Muskeln aufzubauen und die Stärke zu verbessern. Keine Ausrüstung erforderlich, Sie werden die Ergebnisse bald sehen!",

  ///  Plan Test Description Strings
  'plan_test_desc_1': "Der Abstand zwischen Knöcheln beträgt mehr als 1,5 cm, wenn die Beine geglättet sind und die Knie nahe beieinander sind.\n\nklopfknee os eine Bedingung, in der sich die Knie eindringen und sich berühren, wenn die Beine gerichtet sind.",
  'plan_test_desc_2': "Der Abstand zwischen Ihren Knien beträgt mehr als 3 cm, wenn Ihre Füße nahe beieinander liegen.\n\nBowlegs werden durch äußeres Beugen am Knie identifiziert, was bedeutet, dass das Unterbein in Bezug auf die Oberschenkelachse nach innen abgewinkelt ist, was dem Glied insgesamt das Aussehen eines Bogenschützens verleiht.",

  ///  Plan Short Description Strings
  'plan_short_desc_5': "Workouts in dieser Sitzung beinhalten jeden einzelnen Muskeln Ihres Körpers, maximieren Ihr Trainingsergebnis und verbessern Ihre allgemeine Fitness.",
  'plan_short_desc_6': "Zielen Sie Ihren Hintern und Ihre Beine aus allen Blickwinkeln und helfen Ihnen, eine schöne Beute und schlanke Beine schneller zu bekommen als Sie denken!",
  'plan_short_desc_7': "Für diejenigen, die sichtbar gut aussehende Bauchmuskeln wünschen. Passend sowohl Anfänger als auch Trainingskrieger.",
  'plan_short_desc_8': "Schnellarm Fettverbrennung! Slim und formen Sie Ihre Arme nur mit Ihrem Körpergewicht!",
  'plan_short_desc_9': "Wachen Sie mit Energie auf, lassen Sie Ihren Körper für den Tag vorbereiten.",
  'plan_short_desc_10': "Entspannen Sie sich und holen Sie sich einen hochwertigen Schlaf.",
  'plan_short_desc_11': "7 min Training speziell Designs, um Frauen zu helfen, Kurven zu erhalten. Dieses Training deckt Ihren Hintern, Ihren Bauch, Ihre Beine usw. ab.",
  'plan_short_desc_12': "Das effektivste Ganzkörpertraining! Nehmen Sie sich nur 7 Minuten pro Tag, um einen attraktiveren Körper mit einem flachen Bauch, einer runder Beute und den straffen Beinen zu gewinnen.",
  'plan_short_desc_13': "Muskeln lösen und Schmerzen reduzieren",
  'plan_short_desc_14': "Abendessen wirksames intensives Training für Gewichtsverlust. Sie können den ganzen Tag Kalorien verbrennen!",
  'plan_short_desc_15': "Basierend auf ACSM -Forschung entwickelt, die nachweislich Fitness und Gesundheit verbessert.",
  'plan_short_desc_16': "Das effektivste Training für Fettverbrennung. Hohe Intensität\nWorkouts doppelt die Stoffwechselrate für 30 Minuten danach! Nur 4\nmin, keine Ausreden!",
  'plan_short_desc_17': "Dieses hochintensive Training für Ihren Ganzes, kombiniert mit Aerobic-Übungen, hilft Ihnen, in Form zu kommen, wie ein Victoria's Secret\n-Modell!",
  'plan_short_desc_18': "Brennen Sie 100 Cal in nur 10 Minuten! Maximieren Sie die Effizienz mit einem hohen intensiven Training.",
  'plan_short_desc_19': "Schnell und effektiv. Nur 1 0 min Maximieren Sie die Kalorienverbrennung und trainieren Sie Ihren gesamten Körper mit diesem Training mit hoher Intensität.",
  'plan_short_desc_20': "Ultimative Workouts mit hoher Intensität lassen Sie noch mehr Kalorien verbrennen! Ein brutales Fettverbrennungstraining für erfahrene Trainingseinheiten.",
  'plan_short_desc_21': "Zielen Sie auf Ihre Beute, kombinieren Sie ein Training mit Oberschenkeltonent, um Ihre sexy Kurven zu maximieren.",
  'plan_short_desc_22': "Kein Springen! Ein Training mit geringem Aufprall, um Ihre\n-Beine zu formen. Kein Lärm und Wohnungsfreundlichkeit.",
  'plan_short_desc_23': "Brasilianischer Hintern ist kein Traum mehr! Stimulieren Sie Ihren Hintern aus allen Blickwinkeln, um eine sexyere, runder und größere Beute zu erhalten.",
  'plan_short_desc_24': "Nur 3 min Soforttraining! Erzählen Sie einen gut aussehenden Hintern, trotz Ihres verrückten Zeitplanes, nur mit Ihrer fragmentarischen Zeit!",
  'plan_short_desc_25': "Willst du die Oberschenkellücke? Ziele Workouts helfen dabei, inneres Oberschenkelfett zu verbrennen. Anfänger freundlich!",
  'plan_short_desc_26': "Konzentrieren Sie sich auf Ihr Oberschenkelfett. Das beste Training hilft dabei, Ihre Beine und Ihren Hintern zu verschärfen. Mach dir Bikini bereit!",
  'plan_short_desc_27': "Oberschenkelfett in 7 min verbrennen. Training mit geringer Wirkung, das für alle geeignet ist, sogar Menschen mit schwachen Knien.",
  'plan_short_desc_28': "Intensives Training maximiert die innere Oberschenkelfettverbrennung. Keine Bulki -Muskeln!",
  'plan_short_desc_29': "7 min schnelles Booty -Training. Ziehen Sie Ihr Gesäß in kürzerer Zeit fest!",
  'plan_short_desc_30': "Mit hoher Intensitäts -Training spüren Sie, wie Ihr Hintern brennt. Erhöhen Sie die Kurve Ihres Hinterns auf die effizienteste Weise.",
  'plan_short_desc_31': "Helfen Sie, sich zu entspannen und Flexibilität aufzubauen. Es ist auch eine gute Dehnungsroutine zum Laufen und Training.",
  'plan_short_desc_32': "Helfen Sie, sich zu entspannen und Flexibilität aufzubauen. Es ist auch eine gute Dehnungsroutine zum Laufen und Training.",
  'plan_short_desc_33': "Schmerzen lindern und schwache Knie stärken",
  'plan_short_desc_34': "Rollen Sie Knieschmerzen effektiv mit nur einer Schaumstoffwalze weg",
  'plan_short_desc_35': "Spezielle Workouts, die von professionellen Physiotherapeuten entworfen wurden, die darauf abzielen, Klopfknie zu reparieren und Ihren Gang zu korrigieren.",
  'plan_short_desc_36': "Spezielle Workouts von professionellen Physiotherapeuten, die darauf abzielen, Bugbeine zu reparieren und Ihren Gang zu korrigieren.",
  'plan_short_desc_37': "Nur einfache Übungen! Brennen Sie Bauchfett und fest Ihre Bauchmuskeln. Holen Sie sich schnell einen flachen Bauch!",
  'plan_short_desc_38': "Bauchfett verbrennen und Anzeigen mit Brettern bauen. Minimieren Sie Rücken- und Nackenverletzungen.",
  'plan_short_desc_39': "Brennen Sie Bauchfett und straffen Sie Ihren Hintern. Archivieren Sie mehr mit weniger Aufwand.",
  'plan_short_desc_40': "Nur 7 Minuten pro Tag für sichtbare Bauchmuskeln! Beginnen Sie mit einem kurzen und einfachen Training. Keine Ausreden!",
  'plan_short_desc_41': "Ultimative Kerntrainings zur Stärkung der Kernmuskeln und zur Verbesserung der Stabilität. Die hochintensiven Workouts setzen Ihre Bauchmuskeln in Brand!",
  'plan_short_desc_42': "Bretter helfen dabei, die Kernkraft zu gewinnen und ABS mit minimalem Risiko von Rücken- und Nackenverletzungen aufzubauen. Nehmen Sie die Herausforderung für einen stärkeren Kern!",
  'plan_short_desc_43': "Willst du zerkleinerte Bauchmuskeln? Mit hohem Intensitätstraining spüren Sie das Verbrennen in Ihren Bauchmuskeln.",
  'plan_short_desc_44': "Hochintensitäts Bauchfettverbrennungstraining mit After Burn Effect. Brennen Sie auch nach dem Training weiter Kalorien!",
  'plan_short_desc_45': "Hochintensitäts Bauchfettverbrennungstraining mit After Burn Effect. Brennen Sie auch nach dem Training weiter Kalorien!",
  'plan_short_desc_46': "Hochintensitäts Bauchfettverbrennungstraining mit After Burn Effect. Brennen Sie auch nach dem Training weiter Kalorien!",
  'plan_short_desc_47': "Plankenvariationen über 100% Ihrer Kernmuskeln. Perfekt für die Kernverstärkung und hilft, Schmerzen im unteren Rücken zu reduzieren.",
  'plan_short_desc_48': "7 min Arm Fat Sprenging Training! Lassen Sie schlafende Arme los und formen Sie schöne, magere Arme.",
  'plan_short_desc_49': "Keine Liegestütze! Keine Ausrüstung! Ton und formen Sie Ihren Arm mit effektiven Armtrainings.",
  'plan_short_desc_50': "Führen Sie diese anfängerfreundlichen Bewegungen durch, um sich auf traditionelle Liegestütze vorzubereiten.",
  'plan_short_desc_51': "Strecken Sie Ihren Arm, Schulter, Brust und Rücken. Muskeln lösen und die Flexibilität verbessern.",
